import linkedin from '../images/linkedin.png';

export default function CardComponent(props) {
    return (
        <div className="team-card">
            <div className='card-link'>
                <button className='btn-animated'>
                    <a href={props.link} target="_blank" rel="noopener noreferrer"><img src={linkedin} alt='linkedin'/></a>
                </button>  
            </div> 
            <div class="avatar avatar--xl"><img src={props.img} alt="avatar" /></div>
            <div className='card-name'>
                {props.name}
            </div>
            <div className='card-lastname'>
                {props.lastname}
            </div>
            <div className='card-job'>
                {props.job}
            </div>
        </div>
    );
}
